"use strict";$(document).ready(function(){var b=$("#name-input");var c=$("#email-input");var a=$("#message-ta");$(b,c).on("focusout",function(){var d=$.trim($(this).val());if(!d||d===""){showInputError($(this),".empty_error")}else{hideInputError($(this),".empty_error")}});$(a).on("focusout",function(){var d=$.trim($(this).val());if(!d||d===""){showInputError($(this),".empty_error")}else{hideInputError($(this),".empty_error")}});$(".contact-form").on("submit",function(g){g.preventDefault();var i=$.trim(b.val());var d=$.trim(c.val());var h=$.trim(a.val());if(!i||i===""){showInputError(b,".empty_error");return}else{if(!d||d===""){showInputError(c,".empty_error");return}else{if(!h||h===""){showInputError(a,".empty_error");return}}}var f=this;$(f).ajaxSubmit({success:function(e){let evt_data=get_analytices_data();evt_data.name=i;evt_data.email=d;evt_data.message=h;if(e.success){evt_data.success="true";console.log(JSON.stringify(e));notySuccess("Thank you!")}else{evt_data.success="false";if(e.hasOwnProperty("errors")){showErrors(e)}}analytics_event("contact",evt_data)},error:function(e){console.log(JSON.stringify(e));notyError("error")}})})});